func Test_computeSeasonForFetch(t *testing.T) {
	// Arrange
	c := 0
	athletesByName := map[string]string{}

	idFunc := func(n string) string {
		if s, ok := athletesByName[n]; ok {
			return s
		}
		c++
		id := fmt.Sprintf("%d", c)
		athletesByName[n] = id
		return id
	}

	compFunc := func(eventName, courseName string) (competitionAndCourse, error){
		cac := competitionAndCourse{
			competition: &competition{ID: eventName},
			course:      &course{ID: courseName},
		}
		return cac, nil
	}

	var f scrape.SeasonFetch
	err := json.Unmarshal([]byte(jsonSeason2019), &f)
	if err != nil {
		t.Errorf("while unmarshaling season2019, %v", err)
	}

	// Act
	cs, err := computeSeasonForFetch(&f, idFunc, compFunc)

	// Assert
	if err != nil {
		t.Errorf("unexpected error, %v", err)
	}

	if cs.Year != 2019 {
		t.Errorf("unexpected year, got %d", cs.Year)
	}

	a := cs.Athletes["Heitmann, Ståle"]
	if a == nil {
		t.Error("expected athlete, got none.")
	}
	if len(a.Results) != 18 {
		t.Errorf("expected 18 results, got %d", len(a.Results))
	}
}

func Test_computeSeasonForFetch_checkPointsAndPlacements(t *testing.T) {
	// Arrange
	var fetch scrape.SeasonFetch

	err := json.Unmarshal([]byte(jsonSeason2020), &fetch)
	if err != nil {
		t.Errorf("unexpected error, %v", err)
	}

	c := 0
	athletesByName := map[string]string{}

	idFunc := func(n string) string {
		if s, ok := athletesByName[n]; ok {
			return s
		}
		c++
		id := fmt.Sprintf("%d", c)
		athletesByName[n] = id
		return id
	}

	compFunc := func(eventName, courseName string) (competitionAndCourse, error){
		cac := competitionAndCourse{
			competition: &competition{ID: eventName},
			course:      &course{ID: courseName},
		}
		return cac, nil
	}

	// Act
	cs, err := computeSeasonForFetch(&fetch, idFunc, compFunc)

	// Assert
	if err != nil {
		t.Errorf("unexpected error, got %v", err)
	}
	if cs.Year != 2020 {
		t.Errorf("unexpected year, got %d", cs.Year)
	}

	if cs.EventsCount != 24 {
		t.Errorf("expected 24 events, got %d", cs.EventsCount)
	}
	if cs.ValidEventsCount != 16 {
		t.Errorf("expected 16 valid events, got %d", cs.ValidEventsCount)
	}

	a := cs.Athletes["Heitmann, Ståle"]
	if a == nil {
		t.Error("expected athlete, got none.")
	}

	pt := fmt.Sprintf("%f", a.PointsTotal)
	if  pt != "1691.130000" {
		t.Errorf("unexpected total points, got %f", a.PointsTotal)
	}
	pt = fmt.Sprintf("%f", a.WorstResult.Points)
	if pt != "135.370000" {
		t.Errorf("unexpected worst result, got %f", a.WorstResult.Points)
	}
	pt = fmt.Sprintf("%f", a.BestResult.Points)
	if pt != "146.150000" {
		t.Errorf("unexpected best result, got %f", a.BestResult.Points)
	}
	pt = fmt.Sprintf("%f", a.PointsOfficial)
	if pt != "1142.030000" {
		t.Errorf("unexpected official points, got %f", a.PointsOfficial)
	}
	
	var nr1Official *computedAthlete
	for _, athlete := range cs.athleteSlice() {
		if athlete.PlacementOfficial == 1 {
			nr1Official = athlete
		}
	}
	if nr1Official.Name != "Prydz, Espen Beer" {
		t.Errorf("unexpected official number 1, got %s", nr1Official.Name)
	}
}

func Test_computedSeason_officialEventCount(t *testing.T) {
	type fields struct {
		Year             int
		Athletes         map[string]*computedAthlete
		EventsCount      int
		ValidEventsCount int
	}
	tests := []struct {
		name   string
		fields fields
		want   int
	}{
		{"even", fields{ValidEventsCount: 24}, 12},
		{"odd", fields{ValidEventsCount: 23}, 12},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			c := &computedSeason{
				Year:             tt.fields.Year,
				Athletes:         tt.fields.Athletes,
				EventsCount:      tt.fields.EventsCount,
				ValidEventsCount: tt.fields.ValidEventsCount,
			}
			if got := c.officialEventCount(); got != tt.want {
				t.Errorf("officialEventCount() = %v, want %v", got, tt.want)
			}
		})
	}
}

